ield blank to have no suffix added to generated URLs.',34,40,NULL,'2023-06-01 09:20:17',NULL,NULL,NULL),(662,'Format of alternate URLs','USU_FORMAT','original','You can select from a list of commonly generated formats.<br><br><b>Original:</b><ul><li><i>Categories:</i> category-name-c-34</li><li><i>Products:</i> product-name-p-54</li></ul><b>Category Parent:</b><ul><li><i>Categories:</i> parent-category-name-c-34</li><li><i>Products:</i> parent-product-name-p-54</li></ul>',34,50,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_select_option([\'original\', \'parent\'],',NULL),(663,'Display categories as directories','USU_CATEGORY_DIR','short','You can select from a list of commonly generated formats.<br><b>Off:</b> disables displaying categories as directories<br><br><b>Short:</b> use the settings from \'Format of alternate URLs\'<br><br><b>Full:</b> uses full category paths<br><br>',34,60,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_select_option([\'short\', \'full\', \'off\'],',NULL),(664,'Remove problematic characters','USU_REMOVE_CHARS','punctuation','This allows you remove certain problematic characters from the generated URLs.<br><br><i>non-alphanumerical:</i> removes all non-alphanumerical characters<br><i>punctuation:</i> removes all punctuation characters',34,70,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_select_option([\'punctuation\', \'non-alphanumerical\'],',NULL),(665,'Enter PCRE filter rules','USU_FILTER_PCRE','','This setting uses PCRE rules to filter URLs.<br><br>This filter is run before character conversions and stripping of special characters. If you want a dash - in your URLS, use a single space. To escape a character in the regular expression use \\\\ instead of a single \\.<br><br>The format <b>MUST</b> be in the form: <b>find1=>replace1,find2=>replace2</b>. ',34,80,NULL,'2023-06-01 09:20:17',NULL,NULL,NULL),(666,'Filter short words','USU_FILTER_SHORT_WORDS','0','This setting will filter &quot;short&quot; words, i.e. those with length less than or equal to the value specified, from any generated URLs.  Use the value <b>0</b> to include <em>all</em> words.',34,90,NULL,'2023-06-01 09:20:17',NULL,NULL,NULL),(667,'Limit alternate URLS to the following pages','USU_FILTER_PAGES','index, product_info, product_music_info, document_general_info, document_product_info, product_free_shipping_info, products_new, products_all, shopping_cart, featured_products, specials, contact_us, conditions, privacy, reviews, shippinginfo, faqs_all, site_map, gv_faq, discount_coupon, page, page_2, page_3, page_4','You can limit the pages which will be rewritten by specifying them here. If no pages are specified all pages will be rewritten.<br><br>The format is a comma-delimited list (intervening spaces are OK) and <b>must</b> be in the form: <b>page1,page2,page3</b> or <b>page1, page2, page3</b>',34,100,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_textarea(',NULL),(668,'Choose URL Engine','USU_ENGINE','rewrite','Choose which URL Engine to use.',34,110,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_select_option([\'rewrite\'],',NULL),(669,'Enable automatic redirects?','USU_REDIRECT','false','This will activate the automatic redirect code and send 301 headers for old to new URLs.',34,120,NULL,'2023-06-01 09:20:17',NULL,'zen_cfg_select_option([\'false\', \'true\'],',NULL),(677,'Enable One-Page Checkout?','CHECKOUT_ONE_ENABLED','true','Enable the one-page checkout processing for your store? Choose <em>true</em> to enable for all customers, <em>false</em> to disable or <em>conditional</em> to enable the processing only for customers identified by <b>Enable: Customer List</b>.<br><br>Default: <b>false</b>',36,10,'2023-06-07 22:23:16','2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'conditional\', \'false\'),',NULL),(678,'Enable One-Page Checkout Debug?','CHECKOUT_ONE_DEBUG','false','When enabled, debug files named <code>one_page_checkout-<em>xx</em>.log</code> are created in your /logs folder (<em>xx</em> is the customer_id for the checkout).  Use the <b>true</b> setting in combination with the <em>Debug: Customer List</em> setting to limit the customers for which the debug-action is taken.<br><br>Default: <b>false</b>',36,1000,'2023-06-07 22:42:01','2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(679,'Debug: Customer List','CHECKOUT_ONE_DEBUG_EXTRA','','When you enable the plugin\'s debug, use this setting to limit the customers for which the debug-logs are generated.  Leave the setting blank (the default) to debug <b>all</b> customers or identify a comma-separated list of customer_id values to limit the debug to just those customers.<br />',36,1001,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(680,'Version/Release Date','CHECKOUT_ONE_MODULE_VERSION','2.4.5 (2022-12-27)','The One-Page Checkout version number and release date.',36,1,'2023-06-02 09:29:32','2023-06-02 09:29:32',NULL,'zen_cfg_read_only(',NULL),(681,'Update Shipping AJAX Time-out','CHECKOUT_ONE_SHIPPING_TIMEOUT','5000','Enter the timeout to use for the plugin\'s request to update the shipping quotes on the &quot;checkout_one&quot; page. The default setting of 5000 (5 seconds) <em>should work</em> for most stores.  If your store has enabled multiple external shipping methods (e.g. USPS, UPS <b>and</b> FedEx), you might need to increase this value.<br />',36,15,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(682,'Enable: Customer List','CHECKOUT_ONE_ENABLE_CUSTOMERS_LIST','','When you <em>conditionally</em> enable the plugin, use this setting to limit the customers for which the plugin is enabled.  Leave the setting blank (the default) to <em>disable</em> the plugin for all customers or identify a comma-separated list of customer_id values for whom the plugin is to be <em>enabled</em>.<br>',36,11,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(683,'Enable Shipping=Billing?','CHECKOUT_ONE_ENABLE_SHIPPING_BILLING','true','Do you want to enable the <em>Shipping Address, same as Billing</em> for your store?<br><br>Default: <b>true</b>',36,20,NULL,'2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(684,'Payment Methods Requiring Confirmation','CHECKOUT_ONE_CONFIRMATION_REQUIRED','eway_rapid,stripepay,gps','Identify (using a comma-separated list) the payment modules on your store that require confirmation.  If your store requires confirmation on all orders, simply list all payment modules used by your store.<br><br>Use the <code>credit_covers</code> &quot;method&quot; if orders that are fully paid using a Gift Certificate or coupon should also require confirmation.<br><br>Default: <code>eway_rapid,stripepay,gps</code><br>',36,21,'2023-06-02 09:29:32','2023-06-02 09:29:32',NULL,NULL,NULL),(685,'Load Minified Script Files?','CHECKOUT_ONE_MINIFIED_SCRIPT','true','Should the plugin load the minified version of its jQuery scripts, reducing the page-load time for the <code>checkout_one</code> page?<br><br>Default: <b>true</b>.',36,25,'2023-06-07 22:06:27','2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(686,'Order Status: Slamming Control','CHECKOUT_ONE_ORDER_STATUS_SLAM_COUNT','3','Identify the number of back-to-back errors that your store allows when a customer is checking their order\'s status via the <code>order_status</code> page (default: <b>3</b>).  When the customer has reached that threshold, they will be redirected to the <code>time_out</code> page.<br><br>',36,25,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(687,'Enable Guest Checkout?','CHECKOUT_ONE_ENABLE_GUEST','false','Do you want to enable <em>Guest Checkout</em> for your store?<br><br>Default: <b>false</b>',36,30,'2023-06-07 22:23:37','2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(688,'Guest Checkout: Require Email Confirmation?','CHECKOUT_ONE_GUEST_EMAIL_CONFIRMATION','true','Should a guest-customer be required to confirm their email address when placing an order?<br><br>Default: <b>true</b>',36,40,NULL,'2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(689,'Guest Checkout: Pages Allowed Post-Checkout','CHECKOUT_ONE_GUEST_POST_CHECKOUT_PAGES_ALLOWED','download','Identify (using a comma-separated list, intervening blanks are OK) the pages that are <em>allowed</em> once a guest has completed their checkout.  When the guest navigates from the <code>checkout_success</code> page to any page <em><b>not in this list</b></em>, their guest-customer session is reset.<br><br>For example, if your store provides a pop-up print invoice, you would include the name of that page in this list.<br>',36,50,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(690,'Guest Checkout: Disallowed Pages','CHECKOUT_ONE_GUEST_PAGES_DISALLOWED','account, account_edit, account_history, account_history_info, account_newsletters, account_notifications, account_password, address_book, address_book_process, create_account_success, gv_redeem, gv_send, product_reviews_write, unsubscribe','Identify (using a comma-separated list, intervening blanks are OK) the pages that are <em>disallowed</em> during guest-checkout.<br><br>These pages <em>normally</em> require a logged-in customer prior to display, e.g. <code>account</code>.  <b>Do not</b> include the <code>login</code>, <code>create_account</code>, <code>password_forgotten</code> or <code>logoff</code> pages in this list!<br>',36,100,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(691,'Guest Checkout: Disallowed <em>Credit Class</em> Order-Totals','CHECKOUT_ONE_ORDER_TOTALS_DISALLOWED_FOR_GUEST','ot_gv','Identify (using a comma-separated list, intervening blanks are OK) any <em>credit-class</em> order-totals that are <em>disallowed</em> during guest-checkout.<br><br>These order-totals <em>normally</em> require a customer-account for their processing, e.g. <code>ot_gv</code>.<br>',36,105,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(692,'Guest Checkout: Disallowed Payment Methods','CHECKOUT_ONE_PAYMENTS_DISALLOWED_FOR_GUEST','moneyorder, cod','Identify (using a comma-separated list, intervening blanks are OK) any payment methods that are <em>disallowed</em> during guest-checkout.<br><br>These payment methods <em>normally</em> have no validation of purchase &mdash; e.g. <code>moneyorder</code> and <code>cod</code> &mdash; and can, if left enabled, result in unwanted <em>spam purchases</em>.<br>',36,110,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(693,'Enable Account Registration?','CHECKOUT_ONE_ENABLE_REGISTERED_ACCOUNTS','false','Do you want your store\'s <code>create_account</code> processing to create a <em>registered</em> rather than a <em>full</em> account?<br><br>Default: <b>false</b>',36,500,NULL,'2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(694,'Login-Page Layout','CHECKOUT_ONE_LOGIN_LAYOUT','L;P,G,C;B','When you enable the plugin\'s <em>Guest Checkout</em> and/or <em>Account Registration</em>, an alternate formatting of the storefront <code>login</code> page is displayed.  Use this setting to control the 3-column layout of that modified page.<br><br>The value is an encoded string, identifying which block should be displayed in which column.  Columns are delimited by a semi-colon (;) and the top-to-bottom column layout is in the order specified by the block-elements\' left-to-right order.<br><br>The block elements are:<ul><li><b>L</b> ... (required) The email/password login block.</li><li><b>P</b> ... (optional) The PayPal Express Checkout shortcut-button block.</li><li><b>G</b> ... (required) The guest-checkout block.</li><li><b>C</b> ... (required) The create-account block.</li><li><b>B</b> ... (optional) The \"Account Benefits\" block.</li></ul>Default: <b>L;P,G,C;B</b>',36,26,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(695,'Payment-Block Action on Shipping Change','CHECKOUT_ONE_PAYMENT_BLOCK_ACTION','update','Identify the action to be taken for the order\'s &quot;payment-block&quot; when the order\'s shipping-method changes.  Some payment-methods (e.g. <em>square</em>) require that the block <b>not</b> be updated while others are dependent on the shipping-method selected (e.g. a <em>Cash</em> payment is accepted <em>only</em> if the customer has chosen &quot;Store Pickup&quot;).<br><br>Choose <b>no-update</b> if at least one of your store\'s payment methods require that no update be performed.<br><br>Choose <b>update</b>, the default, if <em>none</em> of your store\'s payment methods require no-update.<br><br>If your store has a combination of payment-method requirements, choose <b>refresh</b> &mdash; but any credit-card information entered in the payment-block will be lost upon a shipping-method change!',36,16,NULL,'2023-06-02 09:29:32',NULL,'zen_cfg_select_option(array(\'update\', \'no-update\', \'refresh\'),',NULL),(696,'Order Total, jQuery Selector','CHECKOUT_ONE_OTTOTAL_SELECTOR','#ottotal > #ottotalprice','Identify the CSS/jQuery <code>selector</code> used to locate an order\'s current total value.  The default value, <code>#ottotal > div:first-child</code> applies to the Zen Cart <em>responsive_classic</em> template\'s format.<br>',36,18,'2023-06-07 23:04:04','2023-06-02 09:29:32',NULL,NULL,NULL),(697,'Payment Methods Handling Form Submittal','CHECKOUT_ONE_PAYMENT_METHODS_THAT_SUBMIT','square_webPay','Use a comma-separated list (intervening blanks are OK) to identify any payment methods that handle the checkout form\'s submittal themselves, e.g. <code>square_WebPay</code>, the default.<br>',36,21,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(698,'Guest Checkout: Customer ID','CHECKOUT_ONE_GUEST_CUSTOMER_ID','3','This (hidden) value identifies the customers-table entry that is used as the pseudo-customers_id for any guest checkout in your store.',6,30,NULL,'2023-06-02 09:29:32',NULL,NULL,NULL),(699,'Guest Checkout: Billing-Address ID','CHECKOUT_ONE_GUEST_BILLTO_ADDRESS_BOOK_ID','3','This (hidden) value identifies the address_book-table entry that is used as the pseudo-billing-address entry for any guest checkout in 